import React from 'react';

const Dashboard = () => {
  return (
    <div className="flex items-center justify-center h-screen bg-green-100">
      <h1 className="text-3xl font-bold text-center">Welcome to the Dashboard!</h1>
    </div>
  );
};

export default Dashboard;
